import React from 'react'

const HomeCard = (props) => {
    return(
    <div className="flex flex-col items-center border-0 hover:border-2 border-green-500">
        <i class={`${props.icon} fa-7x fill-current ${props.textColor}`}></i>
        <p class = {`${props.textColor} font-extrabold font-general-font text-2xl`}>{props.text}</p>
    </div>
    );
}

export default HomeCard;
